INSERT INTO `v1_3e1c95379df05c6fc6a1291ae83786ebd84907eb96bc032b5ffa9e57d6898323` VALUES (11, 14112, 0, 0, "上出来、上出来。\nさて、絵も完成したことだし、\nみんなでパパっと片づけをして\n食事にでも行くとするかい。", 0.5, 105611, 1, 10, 14112030, 1);
