INSERT INTO `v1_3e1c95379df05c6fc6a1291ae83786ebd84907eb96bc032b5ffa9e57d6898323` VALUES (11, 14112, 0, 0, "あら？　でも……\n片づけはもう済んでるみたいよ？\nうふふ、いったいどこの「いい子」が\nやってくれたのかしらね～？", 0.5, 105111, 1, 10, 14112035, 1);
