INSERT INTO `v1_3e1c95379df05c6fc6a1291ae83786ebd84907eb96bc032b5ffa9e57d6898323` VALUES (11, 14112, 0, 0, "クスクス……私は見ていましたよ。\nアンナさん、あなたがいそいそと\n後ろで道具を片づけているのを……", 0.5, 102711, 1, 10, 14112040, 1);
