INSERT INTO `v1_3e1c95379df05c6fc6a1291ae83786ebd84907eb96bc032b5ffa9e57d6898323` VALUES (11, 16612, 0, 0, "ふふ、やった！　やったぞ！\nまたしても傑作の完成だ！\nみんなの努力が実る、この瞬間……\n何度やっても達成感があるな！", 0.5, 100911, 1, 10, 16612026, 1);
