INSERT INTO `v1_3e1c95379df05c6fc6a1291ae83786ebd84907eb96bc032b5ffa9e57d6898323` VALUES (11, 25212, 0, 0, "よし、なかなか上手く描けたよ。\nでも、弟くんへの愛を表すには\nまだちょっと足りなかったかなあ？", 0.5, 104911, 1, 10, 25212018, 1);
