INSERT INTO `v1_3e1c95379df05c6fc6a1291ae83786ebd84907eb96bc032b5ffa9e57d6898323` VALUES (11, 25212, 0, 0, "そういうのは今はいいですから！\nでもお姉ちゃん美人で頭良くて強いのに\n絵までうまいんですねえ……\nまさに文句上等？　ってやつですよ。", 0.5, 101111, 1, 10, 25212023, 1);
