INSERT INTO `v1_3e1c95379df05c6fc6a1291ae83786ebd84907eb96bc032b5ffa9e57d6898323` VALUES (11, 25212, 0, 0, "それを言うなら文武両道、\nだねリノちゃん\nでもまあ、マスターとして\nアタシも鼻が高いよ。……なんてね。", 0.5, 106811, 1, 10, 25212028, 1);
